import './price.css';

import fill from '../../assets/business/dollar-fill.png';
import empty from '../../assets/business/dollar-empty.png';

function Price({price}) {
    var priceArray = [];
    for (var i = 0; i < price.length; i++) {
        priceArray.push(<img src={fill} style={{backgroundColor: 'white'}}/>);
    };

    for (var i = 4; i > price.length; i-- ) {
        priceArray.push(<img src={empty} />);
    };

    return (
        <div>
            {priceArray}
        </div>
    )
}

export default Price;
